import React,{Component} from "react";
import {Div0,DataInfoItem} from'./sty';
import Header from '../header/index'
class DataInfoList extends Component{
    render(){
        return (
                <Div0>
                    <Header></Header>
                    <DataInfoItem></DataInfoItem>
                    <DataInfoItem></DataInfoItem>
                    <DataInfoItem></DataInfoItem>
                    <DataInfoItem></DataInfoItem>
                </Div0>
        )}}
export default DataInfoList;
